import React, { useState } from "react";
import { useParams, useLocation, useNavigate } from "react-router-dom";

function FormSettings({ selectedItems, saveFormSettings }) {
  const { formName, id } = useParams(); // Get form name and unique ID from URL
  const location = useLocation();
  const navigate = useNavigate();

  // Retrieve form data passed from Home or find it in selectedItems
  const form = location.state?.form || selectedItems.find((item) => item.id === id) || {
    id,
    name: formName,
    imgSrc: "", // Ensure that imgSrc is initialized (empty or set dynamically)
    settings: { param1: "", param2: "" },
  };

  const [formData, setFormData] = useState(form);

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      settings: {
        ...formData.settings,
        [name]: value,
      },
    });
  };

  // Save settings and navigate back to the home page
  const handleSave = () => {
    saveFormSettings(formData);
    navigate("/");
  };

  // Different fields based on the form type
  const renderFormFields = () => {
    switch (formData.name) {
      case "Intake Form":
        return (
          <>
            <label>
              Age:
              <input
                type="number"
                name="age"
                value={formData.settings.age || ""}
                onChange={handleChange}
              />
            </label>
            <br />
            <label>
              Gender:
              <select
                name="gender"
                value={formData.settings.gender || ""}
                onChange={handleChange}
              >
                <option value="">Select...</option>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
                <option value="Other">Other</option>
              </select>
            </label>
            <br />
            <label>
              Notes:
              <textarea
                name="notes"
                value={formData.settings.notes || ""}
                onChange={handleChange}
              />
            </label>
          </>
        );
      case "Color":
        return (
          <>
            <label>
              Color Type:
              <select
                name="colorType"
                value={formData.settings.colorType || ""}
                onChange={handleChange}
              >
                <option value="">Select...</option>
                <option value="Red">Red</option>
                <option value="Blue">Blue</option>
                <option value="Green">Green</option>
                <option value="Yellow">Yellow</option>
              </select>
            </label>
            <br />
            <label>
              Intensity (1-10):
              <input
                type="range"
                min="1"
                max="10"
                name="intensity"
                value={formData.settings.intensity || 5}
                onChange={handleChange}
              />
            </label>
          </>
        );
      case "Word":
        return (
          <>
            <label>
              Word List:
              <textarea
                name="wordList"
                value={formData.settings.wordList || ""}
                onChange={handleChange}
              />
            </label>
          </>
        );
      case "Color/Word":
        return (
          <>
            <label>
              Color Type:
              <select
                name="colorType"
                value={formData.settings.colorType || ""}
                onChange={handleChange}
              >
                <option value="">Select...</option>
                <option value="Red">Red</option>
                <option value="Blue">Blue</option>
                <option value="Green">Green</option>
                <option value="Yellow">Yellow</option>
              </select>
            </label>
            <br />
            <label>
              Word List:
              <textarea
                name="wordList"
                value={formData.settings.wordList || ""}
                onChange={handleChange}
              />
            </label>
          </>
        );
      default:
        return <p>No specific settings for this form.</p>;
    }
  };

  return (
    <div className="form-settings">
      <h2>{formData.name} Settings</h2>
      {renderFormFields()}
      <br />
      <button onClick={handleSave}>Save</button>
    </div>
  );
}

export default FormSettings;
